@PirateJeans

A leecher is someone who is currently downloading a file. Specifically, someone who is running full-on download while capping their upload ratio to 10 Kb/s or less. Some people have connections that make upload capping a necessity in order to get the file in a timely manner. What makes you a slang "leech" is when you cap your upload to get the file faster, then exit your torrent program or leaving your upload capped so others can't benefit from what you've just downloaded. It's selfish and makes you an evil wench. 

